resources.string:
Tải dữ liệu bản đồ thất bại, sử dụng dữ liệu lưu trữ cục bộ, không tìm thấy bản đồ hợp lệ, vui lòng kiểm tra:
1. Kết nối mạng có bình thường không;
2. Tên bản đồ đã được thiết lập chính xác;
3. Có điểm vị trí cho việc định vị thang máy không;
4. Bản đồ có điểm vị trí và tuyến đường hợp lệ không;

Tải dữ liệu bản đồ thành công, nhưng không tìm thấy bản đồ hợp lệ, vui lòng kiểm tra:
1. Tên bản đồ đã được thiết lập chính xác;
2. Có điểm vị trí cho việc định vị thang máy không;
3. Bản đồ có điểm vị trí và tuyến đường hợp lệ không;
